import { Injectable } from '@angular/core';
import { User } from './userInterface';

@Injectable({
  providedIn: 'root'
})
export class ServiceService {


  constructor() { }

  private _users: User[] = [ ];
  public get users(): User[] {
    return this._users;
  }
  public set users(value: User[]) {
    this._users = value;
  }



}
